import axios from 'axios'
import React, {useEffect, useState} from 'react'
import ProductoIndividual from './ProductoIndividual'
import Buttons from "./Buttons"


function ProductosDisponibles(){

    const[dataproductos, setdataproductos]=useState([])

    //const ProDispo = [...new Set(dataproductos.map((Val) => Val.))];


    useEffect(() => {

        axios.get('api/producto/obtenerproducto').then(res => {
            console.log(res.data)
            setdataproductos(res.data)
        }).catch(err => {
            console.log(err)
        })
       
    },[])

    //Mapera listaproductos en objeto productos
    const listaproductos = dataproductos.map(producto => {
        return(
            <div>
                 <ul className='list-group'>
                        <li className='list-group-item'>Id: {producto.idproducto}</li>
                        <li className='list-group-item'>Nombre: {producto.nombre}</li>
                        <li className='list-group-item'>Precio: {producto.precio}</li>
                        <li className='list-group-item'>Detalle: {producto.detalle}</li>
                        <li className='list-group-item'>Cantidad: {producto.cantidad}</li>
                    </ul>
            </div>
        )
    })



    

}
export default ProductosDisponibles
